  tweets: TweetsState;
};

const Tweets = ({ tweets }: TweetsProps) => {
  return (
    <ul className={styles.container}>
      {/* {tweets.forEach((tweet) => {
        <Tweet tweet={tweet} />;
      })} */}
    </ul>
